import React from 'react';

function LoginPage() {
  return (
    // <div>
    //   LoginPage
    // </div>
    <div className='App'>
      <label>
        <h1>Username:</h1>
        <input className='login-input' size={40} Style={'height: 5'}  type='text' placeholder='Enter your username here...' autoFocus required/>
      </label>
      <br/>
      <br/>
      <label>
        <h1>Password:</h1>
        <input className='login-input' size={40} type='password' placeholder='Enter your password here...' required/>
      </label>
      <br/>
      <br/>
      <br/>
      <button type='submit'>Login</button>
    </div>
  );
}

export default LoginPage;
